import './login.css'

export default function Login() {
  return (
    <div className='login'>
      <div class="wrapper">
        <img src="./images/logo.webp" className='login_logo'></img>
        <h1 class="login__title">Fazer login</h1>
      </div>
    </div>
  )
}
